class Test():
    def binary_treeTest(self, LIST, text):
        t = binary_tree(LIST.split())
        if t == text:
            return(True)
        else:
            return(False)

    def traverseTest(self,LIST, text):            
        t = binary_tree(LIST.split())
        Result = (list(traverse(t, 'pre')), list(traverse(t, 'in')), list(traverse(t, 'post')))
        if Result == text:
            return(True)
        else:
            return(False)
            
    def file_writereadTest(self,filename, testtext):
        t = File_Data()
        result = t.file_writeread(filename, 'r')
        if result == testtext:
            return True
        else:
            return False
        
    def VertexPosListTest(self,filename, testtext):
        t = File_Data()
        result = t.VertexDisList(filename)
        if result == testtext:
            return True
        else:
            print(result)
            return False
            
    def BoundTest(self,filename, letter, testtext):
        H = BBB()
        H.Dis_Table(filename)
        H.Binary_Tree()
        result = H.Bound("A")
        if result == testtext:
            return True
        else:
            print(result)
            return False     

    def LetterTest(self,filename, testtext):
        """ self.Letter = [] # List of Letters used for each Postion ['A','B',...] """
        H = BBB()
        H.Dis_Table(filename)
        result = H.Letter
        if result == testtext:
            return True
        else:
            print(result)
            return False
    
    def DisDicTest(self,filename, testtext):
        """ self.DisDic = {} # {'(A,B)':Distance of the two point, ...} """
        H = BBB()
        H.Dis_Table(filename)
        result = H.DisDic
        if result == testtext:
            return True
        else:
            print(result)
            return False
            
    def PosDicTest(self,filename, testtext):
        """ self.PosDic = {} # {'A':Postion of A, ...} """
        H = BBB()
        H.Dis_Table(filename)
        result = H.PosDic
        if result == testtext:
            return True
        else:
            print(result)
            return False
            
    def ListOfElementsTest(self,filename, testtext):
        """ self.ListOfElements = {} # "A":['A','B','C','D','E','F'],... """
        H = BBB()
        H.Dis_Table(filename)
        H.Binary_Tree()
        result = H.ListOfElements
        if result == testtext:
            return True
        else:
            print(result)
            return False        
            
    def DicOfBinaryTest(self,filename, testtext):
        """ self.DicOfBinary = {} # {'A':Tree with the root of A, ...} """
        H = BBB()
        H.Dis_Table(filename)
        H.Binary_Tree()
        result = H.DicOfBinary
        if result == testtext:
            return True
        else:
            print(result)
            return False
            
    
